    componentDidMount() {
        this.display = null;
        if (this.props.toggle === true)
            this.display = 'block';
        else this.display = 'none'
    }


    render() {
        console.log(this.props.toggle);
        return <div style={{display: this.display}}>TEST</div>
    }
}

export default UserMenu;
